def junkRmv(inputName):

    fname = list(inputName)
    songname = ''
    hyphc = 0


    c1Bool = False
    c2Bool = False

    apC1 = fname.count("'")
    apC2 = fname.count('"')

    if apC1 == 2:
      c1Bool = True

    elif apC2 == 2:
      c2Bool = True

    for i in range(len(fname)):


        if fname[i] == '(' or fname[i] == '{' or fname[i] == '[' or fname[i] == '|':
            break

        if fname[i] == '-':
            hyphc += 1


        if fname[i] == '-' and hyphc == 2:
            break

        
        songname += str(fname[i])

    if c1Bool:
      songname += "'"

    elif c2Bool:
      songname += '"'
    
    return songname



